== 简介 ==
「'''アンノウン・マザーグース'''」(Unknown Mother-Goose)是[[wowaka]](現実逃避P)于2017年8月22日发布的Vocaloid日文'''原创'''曲，是wowaka的第12部Vocaloid作品，由[[初音未来|初音未来 V4X]]演唱。

{{cquote|好久不见了、我是wowaka。|投稿説明文}}

时隔上一作「[[Unhappy Refrain]]」约6年的投稿。收录于初音未来十周年纪念专辑「[[Re:Start]]」中。

